import React from "react";
import Person from "./Persons";

class NameList extends React.Component {
  constructor() {
    super();
    this.state = {
    };
    const persons = [
      {
        id :1, 
        name : 'Ammar',
        job : 'Engineer'
      },
      {
        id :2, 
        name : 'Ahmad',
        job : 'Doctor'
      },
      {
        id :3, 
        name : 'Mohammad',
        job : 'Teacher'
      }
    ]
  }

  render() {
    return persons.map(person => <Person person={person}/> )
  }
}

export default NameList;
